import Link from "next/link";
const Navbar = () => (
  <div>
    <ul>
      <li>
        <Link href="/">
          <a>Home</a>
        </Link>
      </li>
      <li>
        <Link href="/about">
          <a>About</a>
        </Link>
      </li>
    </ul>

    <style jsx>{`
      ul{
        background: #333;
        color: #eee;
        list-style: none;
        display: flex;
      }
      ul li{
        padding: 10 20px;
      }
      a{
        text-decoration: none;
        color: #eee;
      }
    `}</style>
  </div>
);

export default Navbar;
